import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  NavLink
} from "react-router-dom";
import Homepage from './Homepage/homepage';
import AllFlightStatus from './Homepage/Get All Flight Status/AllFlightStatus';
/*
import FlightStatus from './Homepage/Get Specific Flight Status/FlightStatus';
import Status from './Homepage/Get Specific Flight Status/FlightStatus/Status';*/

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <Router>

          <Routes>
          <Route exact path="/" element={<Homepage />} />
          <Route exact path="/allflights" element={< AllFlightStatus/>} />




          </Routes>
        </Router>
      </header>
    </div>
  );
}

export default App;
